script: |
  super -f text -I q11475.spq | sort > q11475.out

inputs:
  - name: q11475.spq
    data: |
      SELECT DISTINCT tab2.col1 + + col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN ( + col1 + + col1 * + col1 ) AND + col2;
  - name: tab2

outputs:
  - name: q11475.out
    data: |
